import React from 'react'

function Cart({cartItems}) {
  return (
    <div>
      {cartItems.map((item) => {
        return (
          <>
            <div key={item.id} className="main">
              <div className="card">
                <div>
                  <img src={item.image} width="180px" alt="" />
                </div>
                <div className="title">
                  {item.title.substring(0, 11)}...
                </div>
                <div>Rs. {item.price} /-</div>
              </div>
            </div>
          </>
        );
      })}
    </div>
  )
}

export default Cart
